import React from 'react'
import Item from './item'
import useData from "./useData"

function Lista (props){

    const data = useData();
    return(
        <>
      {data === null ? (
        <p>Loading...</p>
      ) : (
        <div className="list">
          {this.data.map((i) => (
            <Item 
            key={i.id}
            id={i.id}
            rating={i.rating}
            title={i.title}
            image={i.image} />
          ))}
        </div>
      )}
    </>
    );
}

export default Lista;
